import React from "react";
import { Typography, AppBar, Toolbar, Button, Paper } from "@material-ui/core";
import CustomizedDialogs from "./practice";
import EditModal from "./editmodal";
import EditForm from "./editForm";
import DeleteModal from "./deleteModal";

class Header3 extends React.Component {
    state={
      rows: this.props.data,
    };
  // static getDerivedStateFromProps() {
  //   this.setState({rows: this.props.data});
  // }

  render(){
    console.log('delete props -> ',this.props.data.data)
    console.log('useTable state -> ',this.state.rows);
    return (
      <Paper>
            <Toolbar>
            <Typography variant="h6" style={{ flexGrow: 1 }}>
              <Button variant="outlined" color="secondary">
                Predict
              </Button>
              <Button variant="outlined" color="secondary">
                View Correspondence
              </Button>
            </Typography>
            <Button color="secondary">
              <CustomizedDialogs>
              </CustomizedDialogs>
            </Button>
            <Button color="secondary">
              <EditModal>
                <EditForm />
              </EditModal>
            </Button>
            <Button disabled color="secondary">
              <DeleteModal rows={this.state.rows}/>
            </Button>
          </Toolbar>
        </Paper>
    );
  }
}
export default Header3;
